import React from 'react';
import { useSelector } from 'react-redux';

const MusicianList = () => {
  const musicians = useSelector(state => state.musicians.list);
  const status = useSelector(state => state.musicians.status);

  if (status === 'loading') return <div>Loading musicians...</div>;
  if (status === 'failed') return <div>Error loading musicians</div>;

  return (
    <div className="musician-list">
      <h2>Musicians</h2>
      <ul>
        {musicians.map(musician => (
          <li key={musician.id}>
            <h3>{musician.name}</h3>
            <p>{musician.country}</p>
            <p>Roles: {musician.roles?.join(', ')}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MusicianList;
